import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import AboutImg from "../assects/about-us.jpg";

function About (){
    return(
        <>
        <Navbar/>
        <Hero
            cName="hero"
            heroImg={AboutImg}
            title="Your Journey Your Story"
            text="Choose Your Favourite Destination"
            buttonText="Travel Plan"
            url="/"
            btnClass="show"
        />
        </>
    )
}

export default Home;
